interface IReputationErrors {
    /// @notice Thrown when attempting to reuse a nullifier
    error DuplicateNullifier(uint256 nullifierHash);
}

interface IReputationEvents {
    /// @param nullifierHash The nullifier hash for the verified proof
    /// @dev A placeholder event that is emitted when a user successfully verifies with World ID
    event Verified(uint256 nullifierHash);
}

interface IReputation is IReputationErrors, IReputationEvents {
    // TODO: recommend
    function recommend(
        address recommendedUser,
        uint256 root,
        uint256 nullifierHash,
        uint256[8] calldata proof
    ) external;

    // TODO: getRecommendationsCount
    function getRecommendationsCount(address user) external view returns (uint256);

    /// @dev Provider reports compromised groupId. Which derives in slashing reputation of users.
    function report(uint256 groupId) external;

    /// @dev Provider contract sets user groupId to be able to slash their reputation.
    function setUserGroupId(address providerContractAddress, uint256 groupId, address user) external;
}

