contracts/ServiceProvicer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import {Reputation} from "./helpers/Reputation.sol";
import {IWorldID} from "./interfaces/IWorldID.sol";
import {IServiceProvider} from "./interfaces/IServiceProvider.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IServiceProviderEvents {
    event ServiceRequest(address indexed user, uint256 serviceId, bytes encryptionKey, uint256 timestamp);
    event OrderFulfilled(address indexed user, bytes encryptedConnectionDetails, uint256 expiresAt);
    event Withdrawal(address indexed provider, uint256 amount);
}

interface IServiceProviderErrors {
    error NotEnoughReputation();
    error OnlyProvider();
}

contract ServiceProvider is Reputation, IServiceProviderEvents, IServiceProviderErrors {
    uint256 public price;
    address public provider;
    IERC20 public paymentToken;

    modifier onlyProvider() {
        if (msg.sender != provider) {
            revert OnlyProvider();
        }
        _;
    }

    /// @dev Mapping from user address to order
    mapping(address => bytes32) public userToGroupId;
    mapping(bytes32 => address[]) public groupIdToUsers;

    constructor(
        IWorldID _worldId,
        string memory _appId,
        string memory _actionId,
        IERC20 _token,
        uint256 _price
    ) Reputation(_worldId, _appId, _actionId) {
        paymentToken = _token;
        provider = msg.sender;
        price = _price;
    }

    /// @param serviceId The id of the country at which the service is requested
    function requestService(
        uint256 serviceId,
        bytes calldata encryptionKey
    ) external {
        // check if user has enough reputation
        if (recommendationsCount(msg.sender) < 1) {
            revert NotEnoughReputation();
        }

        // withdraw funds from user
        paymentToken.transferFrom(msg.sender, address(this), price);

        emit ServiceRequest(msg.sender, serviceId, encryptionKey, block.timestamp);
    }

    /// @dev Fulfill orders
    function fulfillOrder(
        address user,
        bytes32 groupId,
        uint256 expiresAt,
        bytes calldata encryptedConnectionDetails
    ) external onlyProvider {
        // add to list of users for groupId
        if (userToGroupId[user] != groupId) {
            groupIdToUsers[groupId].push(user);
            userToGroupId[user] = groupId;
        }

        emit OrderFulfilled(user, encryptedConnectionDetails, expiresAt);
    }

    function reportGroupId(bytes32 groupId) external {
        // for each order with such a groupId slash reputation of user
        address[] memory users = groupIdToUsers[groupId];

        for (uint256 i = 0; i < users.length; i++) {
            slashReputation(users[i]);
        }
    }

    function setPrice(uint256 _price) external onlyProvider {
        price = _price;
    }

    function withdraw(uint256 amount) external onlyProvider {
        // Check if amount is valid
        require(amount > 0, "Amount must be greater than 0");

        // Check if contract has enough balance
        require(paymentToken.balanceOf(address(this)) >= amount, "Insufficient balance");

        // Transfer tokens to provider
        bool success = paymentToken.transfer(provider, amount);
        require(success, "Transfer failed");

        emit Withdrawal(provider, amount);
    }

    function balance() external view returns (uint256) {
        return IERC20(paymentToken).balanceOf(address(this));
    }
}

